import React from "react";
import "./style/Shopping.css";
const Shopping = () => {
  return (
    <div className="main">
      <div className="sideBar"></div>
      <div className="shopping">
        {" "}
        <button></button>
        <button></button>
      </div>
      <div className="cart"></div>
    </div>
  );
};

export default Shopping;
